-- Exportování struktury pro procedura attendance_system.Admin_update_time_board
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `Admin_update_time_board`(
	IN `id_user_data` INT,
	IN `date_on_time_board` DATE,
	IN `time_in` TIME,
	IN `time_out` TIME



)
    DETERMINISTIC
BEGIN
DECLARE counter_time_board_rows, actual_row int;
DECLARE datetime_in_data, datetime_out_data datetime;
DECLARE log_text text;

IF time_in is not null THEN
   SET datetime_in_data = CAST(concat(date_on_time_board,' ',time_in) AS DATETIME);
END IF;	

IF time_out is not null THEN
	SET datetime_out_data = CAST(concat(date_on_time_board,' ',time_out) AS DATETIME);
END IF;

SELECT count(tb.id_time_board) INTO counter_time_board_rows FROM time_board tb WHERE 
tb.id_user = id_user_data and (CAST(tb.time_in as DATE) = date_on_time_board OR CAST(tb.time_out as DATE) = date_on_time_board);

IF counter_time_board_rows = 0 THEN
ELSE
	BEGIN
		SELECT tb.id_time_board INTO actual_row FROM time_board tb WHERE
		tb.id_user = id_user_data and (CAST(tb.time_in as DATE) = date_on_time_board OR CAST(tb.time_out as DATE) = date_on_time_board)
		LIMIT 1;
		IF time_in IS NOT NULL AND time_out IS NOT NULL THEN
			UPDATE time_board SET time_in = datetime_in_data, time_out = datetime_out_data where id_time_board = actual_row; 
			SET log_text = 'UPDATE FULL';
		ELSEIF time_in IS NULL THEN
			IF time_out IS NULL THEN
				DELETE FROM time_board WHERE id_time_board = actual_row;
 				SET log_text = 'DELETE ROW';
			ELSE
				UPDATE time_board SET time_out = datetime_out_data where id_time_board = actual_row; 
				SET log_text = 'UPDATE OUT';
			END IF;		
		ELSEIF time_out IS NULL THEN
			UPDATE time_board SET time_in = datetime_in_data where id_time_board = actual_row; 
			SET log_text = 'UPDATE IN';
		END IF;	
	END;
END IF;
/*return log_text;*/
END//
DELIMITER ;

